import { combineReducers } from "redux";
import toggle from "./toggle";
import text from "./text";
import position from "./position";
import wpm from "./wpm";
import spreeding from "./spreeding";
//combine the reducers
export default combineReducers({
  toggle,
  text,
  position,
  wpm,
  spreeding
});
